    [],nt"revision_timestamp": "2014-04-24T15:03:03.797213",nt"name": "contaminant-concentrations-in-connecticut-and-massachusetts-mink",nt"isopen":
    false,nt"url": null,nt"notes": "It appears that PCB levels in Connecticut
    and Massachusetts mink are high enough to adversely affect reproduction. Although
    levels of contaminants in Massachusetts were lower than those found in Connecticut,
    most of the samples from Massachusetts were from either the eastern or western part
    of the state, and areas that have potentially higher levels of contaminants are
    not represented. A more representative mink sample would have to be collected from
    Massachusetts in order to confirm contaminant levels. We did not find statistically
    significant differences in contaminant levels between watersheds within states.
    We attribute this to our small sample sizes and the high variability in the data.
    It is possible that larger sample sizes would have shown significant statistical
    differences between watersheds.",nt"license_title": "License Not Specified",nt"extras":
